      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + col1 NOT IN ( 21 * + col0, col1, + + col0 + + 0 * + - ( - - col1 ) * col1, + - 99, - + col2 );
  - name: tab1

outputs:
  - name: q889.out
    data: |
